const PokeCard = () => {
  return (
    <Item>
      <Header>
        <Chip>001 이상해씨</Chip>
      </Header>
    </Item>
  );
};

const Item = styled.li`
  display: flex;
  flex-direction: column;
  padding: 8px;
  border: 1px solid #c0c0c0;
  box-shadow: 1px 1px 3px 1px #c0c0c0;
  width: 250px;
  height: 300px;
`;

const Header = styled.section``;

const Chip = styled.div``;

export default PokeCard;
